import React from 'react';
import { FaSearch, FaUser, FaEnvelope } from 'react-icons/fa'; 
import { useNavigate } from 'react-router-dom'; // Import for navigation
import '/home/rguktongole/Desktop/ideanexus/frontend/src/components/dashboard/UserDashboard.css';

const Dashboard = () => {
    const navigate = useNavigate();

    const handleProfileClick = () => {
        navigate('/user-profile'); // Redirect to User Profile Page
    };

    const handleMessagesClick = () => {
        navigate('/chats'); // Redirect to Chats Page
    };

    return (
        <div className="dashboard-container">
            <header className="dashboard-header">
                <div
                    className="profile-logo"
                    title="Profile"
                    onClick={handleProfileClick} // Profile icon functionality
                >
                    <FaUser />
                </div>
                <div className="search-container">
                    <input
                        type="text"
                        className="search-bar"
                        placeholder="Search..."
                        aria-label="Search"
                    />
                    <FaSearch className="search-icon" />
                </div>
                <div
                    className="message-icon"
                    title="Messages"
                    onClick={handleMessagesClick} // Message icon functionality
                >
                    <FaEnvelope />
                    <span className="message-badge">3</span> {/* Example badge */}
                </div>
            </header>

            <main className="dashboard-content">
                <h1>Welcome to IdeaNexus!</h1>
                <p>Your posts, profiles, and interactions will be displayed here. Start exploring!</p>
            </main>
        </div>
    );
};

export default Dashboard;
